import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Play = createReactComponent("Play", ["svg", defaultAttributes, [["polygon", {
  points: "5 3 19 12 5 21 5 3",
  key: "cqruti"
}]]]);
export default Play;
